만약에 두 객체에서 동일한 Shape를 사용한다면 어떻게 될까? 먼저 하나의 객체 a 에 x = 5 라는 값을 가진 프로퍼티가 있다고 하면 B_Engine_13.png 이번엔 객체 b 에서 y 라는 프로퍼티를 추가할 경우 Shape(empty) 에서 가지를 뻗어 새로운 Shape(y) 를 만든다. 결국 2개의 체인에 3개의 Shape를 가진 트리 체인이 생성되는 것이다. B_Engine_14.png java의 Object처럼 모든 객체의 트리를 거슬러 올라가면 무조건 Shape(empty) 에 도달하게 되는 것은 아니다. const obj1 = {};
obj1.x = 6; const ob2 = {x: 6}; ojb2 와 같이, JS에서는 Object Literal 을 사용하여 시작부터 프로퍼티를 가지고 생성하도록 할 수 있기 때문이다. 따라서 Shape(empty) 가 아닌, 서로 다른 Root Shape 가 생성된다. B_Engine_15.png 이 방법은 transition chain 을 짧게 하고, 객체를 리터럴로부터 생성하여 더욱 효율적이다. point는 x,y,z 를 3차원 공간의 좌표로 가지는 객체이다. const point = {}; point.x = 4;
point.y = 5;
point.z = 6; 앞서 배운 것에 따르면, 총 3개의 Shape가 메모리에 생성 될 것입니다. (empty Shape 제외) B_Engine_16.png 만약 이걸 사용하는 프로그램에서 x 프로퍼티에 접근한다고 하면, 엔진은 가장 마지막에 생성된 Shape(x,y,z) 부터 링크드 리스트를 따라올라가 맨 위에 있을 x 를 찾는다. 객체의 프로퍼티가 더 많을수록, 그리고 이 과정을 자주 반복한다면 프로그램은 상당히 느려질 것이다. 그래서 엔진은 탐색 속도를 높이기 위해 내부적으로 ShapeTable 이라는 자료구조를 추가한다. 이는 딕셔너리 형태로, 각각의 Shape를 가리키는 프로퍼티 키를 저장하고 있다. B_Engine_17.png 그렇다면 기껏 Shape가 나온 이유가 없어지는 것인가? 사실 엔진은 최적화를 위해 또 다른 방법인 Inline Cache (IC) 라는 것을 Shape에 적용한다. Chrome dev_tool Memory Tab에서 예제를 확인해보자!!! :point_right: 예제 function Person(name) { this.name = name;
} var foo = new Person("yonehara");
var bar = new Person("suzuki"); :point_right: 예제2 function Person(name) { this.name = name;
} var foo = new Person("yonehara");
var bar = new Person("suzuki");
foo.job = "frontend";

