실행 스택은 우리가 위에서 보았다. Call Stack의 개념이다. LIFO (Last In, First Out) 원리를 사용하여 함수 호출을 임시 저장하고 관리하는 데이터 구조이다. 실행컨텍스트를 만드는데 2개의 단계가 있다. Creation 단계 Execute 단계 Creation 단계 한국말로는 만드는 단계이다. 먼저 2가지를 만든다. LexicalEnvironment VariableEnvironment 기본적인 형태는 아래와 같다. ExecutionContext = { LexicalEnvironment = <ref. to LexicalEnvironment in memory>, VariableEnvironment = <ref. to VariableEnvironment in memory>,
} Lexical Environment Lexical Environment은 식별자, 변수 맵핑 을 가지고 있는 구조이다. 여기서 식별자는 변수/함수의 이름을 가리키며 변수는 실제 객체 [함수 객체 및 배열 객체 포함] 대한 참조입니다. var a = 20;
var b = 40; function foo() { console.log('bar');
} 위와 같은 코드가 있다고 하면 Lexical Environment은 lexicalEnvironment = { a: 20, b: 40, foo: <ref. to foo function>
} 위와 같이 만들어질 것이다. 여기에는 3가지의 정보를 가지고 있다. Environment Record : 변수 및 함수 선언이 Lexical Environment 내에 저장되는 장소 Reference to the outer environment : 외부 환경에 대한 참조 This binding : this 가 결정되거나 설정된다. Environment Record 기본적으로 2가지 정보를 담고 있다. Declarative environment record (선언적 환경 정보) : 변수 및 함수 선언을 저장합니다. Object environment record (객체 환경 정보) : 전역 코드의 Lexical Environment에는 객체 환경 레코드가 포함되어 있다. 변수 및 함수 선언 외에 객체 환경 레코드는 전역 바인딩 개체 (브라우저의 창 개체)도 저장합니다. 따라서 각 바인딩 객체의 속성에 대해 새 항목이 레코드에 만들어진다. 함수 코드의 경우 Environment Record에는 함수에 전달된 인덱스와 인수 사이의 매핑과 함수에 전달된 인수의 길이가 포함된 arguments 객체도 포함이 된다. 예를 들어, 아래 함수에 대한 인수 객체는 다음과 같습니다. function foo(a, b) { var c = a + b;
} foo(2, 3); // argument object
Arguments: {0: 2, 1: 3, length: 2}, Reference to the Outer Environment 외부 환경에 대한 참조는 outer environment에 액세스 할 수 있음을 의미한다. 즉, 자바스크립트 엔진은 현재 lexical environment에서 찾을 수 없는 경우 outer environment에서 변수를 찾을 수 있다. This Binding 여기에는 어렵고도 중요한 개념인 this 가 결정되거나 설정된다. 전역 실행 컨텍스트에서이 값은 전역 개체를 참조합니다. 함수 실행 컨텍스트에서이 값은 함수가 호출되는 방식에 따라 다르게 this 가 나온다. 객체 참조 때문에 호출되면 this 값은 해당 객체로 설정되고, 그렇지 않으면이 값은 전역 객체로 설정되거나 정의되지 않는다. const person = { name: 'peter', birthYear: 1994, calcAge: function() { console.log(2018 - this.birthYear); }
} person.calcAge(); // 'this' refers to 'person', because 'calcAge' was called with //'person' object reference const calculateAge = person.calcAge;
calculateAge();
// 'this' refers to the global window object, because no object reference was given Variable Environment 이것은 위에서 봐왔던 LexicalEnvironment와 같다. ES6에서 LexicalEnvironment 구성 요소와 VariableEnvironment 구성 요소의 차이점 중 하나는 함수 선언과 변수 ( let 및 const )바인딩을 저장하는데 사용되는 반면, 후자는 변수 ( var )바인딩만 저장하는 데 사용된다. Execute 단계 이 단계에서 모든 변수에 대한 할당이 완료되고 코드가 최종적으로 실행된다. let a = 20;
const b = 30;
var c; function multiply(e, f) { var g = 20; return e * f * g;
} c = multiply(20, 30); GlobalExectionContext = { LexicalEnvironment: { EnvironmentRecord: { Type: "Object", // Identifier bindings go here a: < uninitialized >, b: < uninitialized >, multiply: < func > } outer: <null>, ThisBinding: <Global Object> }, VariableEnvironment: { EnvironmentRecord: { Type: "Object", // Identifier bindings go here c: undefined, } outer: <null>, ThisBinding: <Global Object> }
} GlobalExectionContext = { LexicalEnvironment: { EnvironmentRecord: { Type: "Object", // Identifier bindings go here a: 20, b: 30, multiply: < func > } outer: <null>, ThisBinding: <Global Object> }, VariableEnvironment: { EnvironmentRecord: { Type: "Object", // Identifier bindings go here c: undefined, } outer: <null>, ThisBinding: <Global Object> }
} FunctionExectionContext = {
LexicalEnvironment: { EnvironmentRecord: { Type: "Declarative", // Identifier bindings go here Arguments: {0: 20, 1: 30, length: 2}, }, outer: <GlobalLexicalEnvironment>, ThisBinding: <Global Object or undefined>, }, VariableEnvironment: { EnvironmentRecord: { Type: "Declarative", // Identifier bindings go here g: undefined }, outer: <GlobalLexicalEnvironment>, ThisBinding: <Global Object or undefined> }
} FunctionExectionContext = { LexicalEnvironment: { EnvironmentRecord: { Type: "Declarative", // Identifier bindings go here Arguments: {0: 20, 1: 30, length: 2}, }, outer: <GlobalLexicalEnvironment>, ThisBinding: <Global Object or undefined>, }, VariableEnvironment: { EnvironmentRecord: { Type: "Declarative", // Identifier bindings go here g: 20 }, outer: <GlobalLexicalEnvironment>, ThisBinding: <Global Object or undefined> }
} 함수가 완료된 후 반환 값은 c 안에 저장된다. 그래서 글로벌 Variable Environment이 업데이트된다. 그 후, 전역 코드가 완료되고 프로그램이 완료된다. let 및 const 정의 변수는 생성 단계에서 연관된 값이 없지만 var 정의 변수는 undefined 로 설정된다. 이는 생성 단계에서 함수 선언이 환경에 전체적으로 저장되는 동안 변수 및 함수 선언에 대해 코드가 검색되고 변수가 초기에 undefined ( var 의 경우)로 설정되거나 초기화되지 않은 상태로 유지되기 때문이다. let 과 const 의 경우). 이것이 var 정의 변수가 선언되기 전에 (정의되지는 않았지만) var 정의 변수에 액세스할 수 있지만 let 및 const 변수가 선언되기 전에 액세스 할 때 참조 오류가 발생하는 이유이다. 실행 단계에서 자바스크립트 엔진이 let 변수의 값을 소스 코드에서 선언된 실제 위치에서 찾지 못하면 정의되지 않은 값을 할당한다.

