Class 문법이 생기기 전에는 JavaScript에서는 모든 것을 Function으로 만들어야 했다. 그래서 사람들이 Class처럼 사용하기 위해서 Constructor function을 사용해서 비슷하게 사용하였다. function Vehicle(make, model, color) { this.make = make, this.model = model, this.color = color, this.getName = function () { return this.make + " " + this.model; }
} 위와 같이 함수를 선언함으로써 Java에서 사용하는 Class와는 모양새는 다르지만, Class에 좀 더 가까워졌다. 이제 우리는 Vehicle 이라는 것을 선언했으니 인스턴스를 만들어보자 const car = new Vehicle("Toyota", "Corolla", "Black");
const car2 = new Vehicle("Honda", "Civic", "White"); 위와 같이 new 키워드를 사용해서 인스턴스를 만들 수 있다. 그런데 문제가 있다. 새로운 Vehicle() 을 만들 때 JavaScript 엔진은 두 객체의 각각에 대한 Vehicle Constructor 함수 사본을 만든다. 즉 각각의 인스턴스의 공간이 만들어지는 것이다. 또한 속성과 메소드는 Vehicle() 의 모든 인스턴스에 복사가 된다. 이게 왜 문제가 되는가? 라고 생각할 수 있다. 제일 문제는 Constructor 함수의 멤버 함수(메서드)가 모든 객체에서 반복된다. 계속 똑같은 멤버 함수를 만드는 것이다. 이것은 매우 불필요하게 낭비를 하기 때문이다. 다른 문제는 기존의 만든 객체에 새로운 속성이나 메서드를 추가를 하지 못한다는 것이다. car2.year = "2019" 위와 같이 추가를 하더라도 다른 인스턴스에는 새로운 속성이나 메서드는 따로따로 넣어주어야 한다. function Vehicle(make, model, color, year) { this.make = make, this.model = model, this.color = color, this.year = year, // 위와 같이 추가를 해야한다. this.getName = function () { return this.make + " " + this.model; }
}

