이제 Constructor 함수와 prototype 에 대해 알아봤다. 이제 Class에 대해 알아보자. 위의 2개를 살펴봄으로써 좀 더 쉽게 이해할 수 있다. 이전의 것들과 크게 차이가 나는 것이 없기 때문이다. JavaScript 클래스는 prototype 기능을 활용하여 Constructor 함수를 작성하는 새로운 방법일 뿐이다.( syntactic sugar ) class Vehicle { constructor(make, model, color) { this.make = make; this.model = model; this.color = color; } getName() { return this.make + " " + this.model; }
} 생성 방법은 위처럼 만들면 된다. 위와 동일하게 인스턴스를 생성해보면 동일하게 new 키워드를 사용하면 된다. const car = new Vehicle("Toyota", "Corolla", "Black"); Class로 만든 것을 기존 방법으로 다시 작성한다면 아래와 같을 것이다. function Vehicle(make, model, color) { this.make = make; this.model = model; this.color = color;
} Vehicle.prototype.getName = function () { return this.make + " " + this.model;
} const car = new Vehicle("Toyota", "Corolla", "Black"); 이것은 Class가 Constructor 함수를 수행하는 새로운 방법이라는 것을 증명한다. 더욱 실제 Class와 비슷하게 만들기 위해서 도입된 몇 가지 규칙이 있다. 생성자가 작동하려면 new 키워드가 필요하다. const car = new Vehicle("Toyota", "Corolla", "Black"); new 를 사용하지 않고 만들 경우 아래와 같은 에러가 발생한다. Class의 메서드는 non-enumerable 하다. JavaScript에서 객체의 각 속성에는 해당 속성에 대해 enumerable flag 가 있다. Class는 prototype 에 정의된 모든 메서드에 대해 이 flag 를 false 로 설정한다. Class에 생성자를 추가하지 않으면 기본 빈 constructor() 가 자동으로 추가된다. constructor(){ } Class 안의 코드는 항상 strict 모드 이다. 이것은 오류가 없는 코드를 작성하거나, 잘못된 입력 또는 코드 작성 중 구문 오류 또는 다른 곳에서 참조된 실수로 일부 코드를 제거하여 코드를 작성하는 데 도움을 준다. Class는 호이스팅이 되지 않는다. image Class는 Constructor 함수나 객체 리터럴과 같은 속성 값 할당을 허용하지 않는다. 함수 또는 getter/setter 만 가질 수 있다. property:value 할당은 불가능하다.

