constructor constructor 는 Class 자체를 나타내는 함수 자체를 정의하는 Class 선언의 특수 함수 이다. 인스턴스를 새로 만들면 constructor() 가 자동으로 호출된다. const car = new Vehicle("Honda", "Accord", "Purple"); // call constructor constructor 는 super 키워드를 사용하여 확장된 Class constructor 를 호출할 수 있다. 하나 이상의 생성자 함수를 가질 수 없다. Static Methods Static Methods는 prototype 에 정의된 Calss의 다른 메서드와는 다르게 prototype 이 아닌 Class 자체의 함수이다. Static Methods는 static 키워드를 사용하여 선언하며 주로 유틸리티 함수를 만드는 데 사용된다. Class의 인스턴스를 만들지 않고 호출 가능하다. class Vehicle { constructor(make, model, color) { this.make = make; this.model = model; this.color = color; } getName() { return this.make + " " + this.model; } static getColor(v) { return v.color; }
} let car = new Vehicle("Honda", "Accord", "Purple"); Vehicle.getColor(car); // "purple" 정적 메서드는 Class 인스턴스에서 호출할 수 없다. Getter / Setter getter/setter를 사용하여 속성값을 가져오거나 속성값을 설정할 수 있다. class Vehicle { constructor(model) { this.model = model; } get model() { return this._model; } set model(value) { this._model = value; }
} getter/setter는 Class prototype 에 정의된다. image Subclassing Subclassing은 Javascript Class에서 상속을 구현할 수 있는 방법으로 extends 키워드는 Class의 하위 클래스를 만드는 방법이다. class Vehicle { constructor(make, model, color) { this.make = make; this.model = model; this.color = color; } getName() { return this.make + " " + this.model; }
} class Car extends Vehicle{ getName(){ return this.make + " " + this.model +" in child class."; }
} const car = new Car("Honda", "Accord", "Purple"); car.getName(); // "Honda Accord in child class." getName() 를 호출하면 자식클래스의 함수가 호출된다. 가끔 부모의 함수를 사용해야 할 때가 있다. 그럴 때는 super 키워드를 사용하면 된다. class Car extends Vehicle{ getName(){ return super.getName() +" - called base class function from child class."; }
} 옛날 방식인 prototype 을 사용해서 상속 구현해보기 function Vehicle(make, model, color) { this.make = make; this.model = model; this.color = color;
} Vehicle.prototype.getName = function() { return this.make + " " + this.model;
}; function Car(make, model, color) { this.make = make; this.model = model; this.color = color;
}
Object.setPrototypeOf(Car, Vehicle);
Object.setPrototypeOf(Car.prototype, Vehicle.prototype);
Car.prototype.getName = function() { return this.make + " " + this.model +" in child class.";
}; const vehicle = new Vehicle("Honda", "Accord", "Purple");
const car = new Car("Honda", "Accord", "Purple"); console.log(vehicle.getName()); // Honda Accord
console.log(car.getName()); // Honda Accord in child class.

