한가지 예제를 살펴보고 console.log() 가 어떻게 출력이 되는지 확인해보자. // 함수
const greeting = () => { console.log(this);
} const module = { greeting() { console.log(this); }
} greeting(); // window object module.greeting(); // module object 흔히 사람들이 실수하는 코드 중 하나이다. 여기서 제일 유심히 보아야 하는 것은 this 가 다르다는 것이다. Java나 다른 언어에서의 this 와는 다르게 작동하고 있다는 것은 확실하다. this 에 대한 더 많은 내용은 아래의 참고 글을 읽어보길 바란다. 참고 scope this JavaScript의 this function Module(name) { this.name = name;
} Module.prototype.getName = function() { var changeName = function() { console.log(this); // window return this.name + '입니다.'; } return changeName();
} const module = new Module('sNyung'); console.log(module.getName()); 위와 같이 메서드 내부에서 함수를 정의하고 this 를 사용하게 되면 Module이라고 생각하지만 window 를 바라보고 있다. 그리고 이걸 해결하는 방법은 흔히 self 또는 that 을 사용해서 해결한다. function Module(name) { this.name = name;
} Module.prototype.getName = function() { const self = this; // const that = this; const changeName = function() { console.log(self); // Module return self.name + '입니다.'; } return changeName();
} const module = new Module('sNyung'); console.log(module.getName()); 또는 ES6에서 추가가 된 화살표 함수(Arrow Function)를 사용해서 해결 가능하다. function Module(name) { this.name = name;
} Module.prototype.getName = function() { const changeName = () => { console.log(this); // Module return this.name + '입니다.'; } return changeName();
