foo.test(); // false, 10 그렇다면 어떻게 해야 this가 바뀌는 것일까? 컨텍스트의 코드를 활성화한 호출자(caller)에 의해 제공된다. 즉 함수를 호출한 부모 컨텍스트가 존재한다는 것이다. 어떤 컨텍스트의 this 가 참조하는 값을 어려움 없이 알아내기를 원한다면 중요한 이 부분을 이해하고 기억해야 한다. 정확하게 호출 표현식의 형태, 즉 다른 무엇이 아닌 함수를 호출한 방법이 호출된 컨텍스트 의 this 값에 영향을 준다. this 값은 함수가 어떻게 정의되었는가에 따라 정해진다. 전역 함수라면 this 는 전역 객체를 값으로 갖게 되고, 객체의 메서드라면 this 는 항상 이 객체를 값으로 갖는다. function foo() { console.log(this);
} foo(); // global console.log(foo === foo.prototype.constructor); // true foo.prototype.constructor(); // foo.prototype 위의 코드가 무슨 의미인지 모를 수 있다. 먼저 foo === foo.prototype.constructor 이 부분을 보면 전역 함수인 foo 가 foo.prototype.constructor 가 같으므로 둘 다 전역이라고 생각할 수 있다. 그렇다면 foo.prototype.constructor 를 실행하게 되면, 당연히 this 는 global 이 되어야 한다고 생각한다. 그러나 실제 결과는 다르다! 이것과 유사하게 어떤 객체의 메서드로 정의된 함수를 호출하는 경우에서도 this 가 달라질 수 있다. var foo = { bar: function () { console.log(this); console.log(this === foo); }
}; foo.bar(); // foo, true var exampleFunc = foo.bar;
console.log(exampleFunc === foo.bar); // true exampleFunc(); // global, false 이 경우도 똑같다고 생각하면 된다. exampleFunc === foo.bar 의 결과가 같다면 this 는 같은 것이 나올거라 일반적으로 생각을 할 것이다. 그런데 결과를 보게 되면 놀랍다. global 이 나온다. 그렇다면 호출 표현식의 형태 가 어떻게 this 에 영향을 미칠까? this 가 갖는 값을 결정하는 과정을 완벽하게 이해하기 위해서, 내부 타입 중에 하나인 레퍼런스 타입(Reference type) 에 대해서 자세하게 알 필요가 있다.

186.body:
레퍼런스 타입은 수도 코드를 이용해서 base (프로퍼티가 속해 있는 객체)와 이 base 안에 있는 propertyName 이라는 2개의 프로퍼티를 가진 객체로 나타낼 수 있다. var valueOfReferenceType = { base: <base object>, propertyName: <property name>
}; 레퍼런스 타입의 값은 오직 아래의 2가지 경우에만 있을 수 있다. 내가 볼 때 아래에 2가지 경우가 this 를 이해하는데 핵심이다. 1. 식별자(identifier)를 다룰 때
2. 프로퍼티 접근자(property accessor)를 다룰 때. 식별자는 알고리즘이 항상 레퍼런스 타입 값( this 와 관련해서 중요하다)을 결과로 돌려준다는 것만 명심하자. 식별자는 변수 이름, 함수 이름, 함수 전달인자의 이름 그리고 전역 객체의 비정규화 프로퍼티의 이름을 뜻한다. var foo = 10; // 변수이름
function bar() {} // 함수이름 중간결과는 아래와 같이 될 것이다. var fooReference = { base: global, propertyName: 'foo'
}; var barReference = { base: global, propertyName: 'bar'
}; 레퍼런스 타입 값으로부터 객체가 가진 실제 값을 얻기 위해 쓰이는 GetValue 메서드가 있는데 이 메서드를 수도 코드로 아래와 같이 나타낼 수 있다. function GetValue(value) { if (Type(value) != Reference) { return value; // 레퍼런스 타입이 아니면 값을 그대로 돌려준다. } var base = GetBase(value); if (base === null) { throw new ReferenceError; } return base.[[Get]](GetPropertyName(value))
} 위에서 내부 [[Get]] 메서드는 프로토타입 체인으로부터 상속된 프로퍼티까지 분석해서 객체 프로퍼티의 실제 값 을 돌려준다. GetValue(fooReference); // 10
GetValue(barReference); // function object "bar" (중요)프로퍼티 접근자는 점 표기법(프로퍼티 이름이 정확한 식별자이고 미리 알 수 있을 때)이나 대괄호 표기법의 2가지 방법으로 표기할 수 있다. foo.bar();
foo['bar'](); 이번에도 중간 계산의 결과로 레퍼런스 타입의 값을 갖게 된다. var fooBarReference = { base: foo, propertyName: 'bar'
}; GetValue(fooBarReference); // function object "bar" 그렇다면, 레퍼런스 타입의 값과 함수 컨텍스트의 this 값은 어떤 관계일까? 이 부분이 가장 중요하며, 이 글의 메인이다 . 함수 컨텍스트의 this 값을 결정하는 일반적인 규칙은 다음과 같이 말할 수 있다. 함수 컨텍스트의 this 값은 호출자가 제공하며 호출 표현식의 현재 형태에 의해서 그 값이 결정된다 (함수 호출이 문법적으로 어떻게 이뤄졌는지에 따라서). 호출 괄호(…)의 왼편에 레퍼런스 타입의 값이 존재하면, this 는 레퍼런스 타입의 this 값인 base 객체를 값으로 갖는다. 다른 모든 경우에는(레퍼런스 타입이 없는 다른 모든 값의 경우), this 값은 항상 null 로 설정된다. 그러나 null 은 this 의 값으로 의미가 없기 때문에 암묵적으로 전역 객체로 변환된다. 예제 function foo() { return this;
}
foo(); // global 호출 괄호 왼쪽에 레퍼런스 타입 값이 있다. ( foo 는 함수이름으로 식별자이다) var fooReference = { base: global, propertyName: 'foo'
}; 따라서, this 값은 레퍼런스 타입 값의 base 객체인 전역 객체로 설정된다. var foo = { bar: function () { return this; }
};
foo.bar(); // foo 여기에서 다시 base 가 foo 객체인 레퍼런스 타입의 값을 갖게 되고, 이것은 bar 함수 활성화 시에 this 값으로 이용된다. var fooBarReference = { base: foo, propertyName: 'bar'
}; 그러나, 또 다른 형태의 호출 표현식으로 함수를 활성화하면 this 값은 달라진다. var test = foo.bar;
test(); // global test 가 식별자가 되면서 다른 레퍼런스 타입 값을 만들기 때문에, 이 레퍼런스 타입의 base (전역 객체)가 this 값으로 사용된다. var testReference = { base: global, propertyName: 'test'
}; 이제는 다른 형태의 호출 표현식으로 활성화된 같은 함수가, 또한 다른 this 값을 갖는지를 정확하게 이야기할 수 있다 => 레퍼런스 타입의 중간값이 달라서 일어나는 현상 function foo() { alert(this);
}
foo(); // 전역이기 때문에 var fooReference = { base: global, propertyName: 'foo'
}; alert(foo === foo.prototype.constructor); // true // 호출 표현식의 또 다른 형태
foo.prototype.constructor(); // foo.prototype이기 때문에 var fooPrototypeConstructorReference = { base: foo.prototype, propertyName: 'constructor'
}; 호출 표현식 형태에 따라 this 값이 동적으로 결정되는 또 다른 예제가 있다. function foo() { alert(this.bar);
} var x = {bar: 10};
var y = {bar: 20}; x.test = foo;
y.test = foo; x.test(); // 10
y.test(); // 20

