with 객체가 함수 이름 프로퍼티를 갖는 경우, with 문의 블록 안에서 함수를 호출할 때는 예외일 수 있다. with 문은 자신의 스코프 체인의 가장 앞, 즉 활성화 객체 앞에 그 객체를 추가한다. 따라서 레퍼런스 타입 값을 얻으려 할 때(식별자나 프로퍼티 접근자를 이용해서) 활성화 객체가 아닌 with 문의 객체를 base 객체로 갖게 된다. 그런데, 이는 with 객체가 스코프 체인에서 더 상위에 있는(전역 객체 또는 활성화 객체) 객체까지 가려버리기 때문에 중첩함수뿐만 아니라 전역 함수와도 관련이 있다. var x = 10;
with ({ foo: function () { alert(this.x); }, x: 20
}) { foo(); // 20
}
// because
var fooReference = { base: __withObject, propertyName: 'foo'
}; catch 절의 실제 파라미터인 함수를 호출할 것도 이와 유사하다. 이 경우에 항상 스코프 체인의 가장 앞, 즉 활성화 객체나 전역 객체 앞에 catch 객체가 추가된다. 그러나 이 동작은 ECMA-262-3 의 버그로 인정되어 새로운 버전인 ECMA-262-5 에서는 수정된다. ECMA-262-5 는 이러한 경우 this 값이 catch 객체가 아닌 전역 객체로 설정된다. try { throw function () { alert(this); };
} catch (e) { e(); // __catchObject - ES3, global - ES5에서는 수정
}
// on idea
var eReference = { base: __catchObject, propertyName: 'e'
};
// 그러나, 이것은 버그이기 때문에
// this는 강제로 전역 객체를 참조하게 된다.
// null => global
var eReference = { base : global, propertyName: 'e'
}

