컨텍스트 단계로 들어갈 때 변수/활성화 객체(VO/AO)가 함수 선언으로 들어간다. var x = 10; function foo() { var y = 20; alert(x + y);
} foo(); // 30 함수가 활성화가 되면 함수는 30 을 출력한다. 여기에서 변수 y 는 함수 foo 에서 정의되어있지만, 변수 x 는 foo 의 컨텍스트에 정의되어 있지 않다. 그러므로 foo 의 AO 에 추가되지 않는다. 그렇다면 x 는 foo 에 존재하지 않는 것인가? fooContext.AO = { y: undefined // undefined – 컨텍스트 접근시, 20 – 활성화시
}; foo 컨텍스트의 활성화 객체는 y 프로퍼티만을 가진다. 그렇다면 어떻게 해서 함수 foo 가 변수 x 에 접근할 수 있을까? [[Scope]] 는 현재 함수 컨텍스트의 상위에 있는 모든 부모 변수 객체의 계층 체인 이다. 이 체인은 함수가 생성될 때 함수에 저장 된다. 함수를 생성할 때 [[Scope]] 프로퍼티가 함수에 저장되는데, 일단 한 번 저장되면 함수가 사라질 때까지 정적으로 변하지 않는다 는 사실을 주목하자. 함수를 결코 호출할 수 없어도 , 함수 객체는 이미 [[Scope]] 프로퍼티를 가지고 있다. foo.[[Scope]] = [ globalContext.VO // === Global
];

197.body:
컨텍스트로 진입하고 AO/VO 가 만들어진 후에, 컨텍스트의 scope 프로퍼티는 다음과 같이 정의된다. Scope = AO|VO + [[Scope]] 여기서 중요한 것은 활성화 객체가 Scope 배열의 첫 번째 원소로 제일 앞으로 온다는 것이다. Scope = [AO].concat([[Scope]]); 식별자 해석은 변수(또는 함수 선언)가 ScopeChain의 어떤 변수 객체에 속하는지를 결정하는 과정이다. 식별자 해석 과정은 변수의 이름에 해당하는 프로퍼티를 검색하는 과정을 포함하며, ScopeChain 가장 깊은 곳에 있는 컨텍스트의 변수 객체부터 시작해서 가장 위에 있는 변수 객체까지 연속적으로 검사하는 과정이다. 그 결과 현재 컨텍스트의 지역 변수는 부모 컨텍스트에 있는 변수보다 검색 우선순위를 가지며 , 이름이 같지만 서로 다른 컨텍스트에 존재하는 두 변수가 있으면, 더 깊은 컨텍스트에 있는 변수가 우선한다. 즉 가까운 곳에 있는 변수가 우선순위가 높다는 것이다. var x = 10; function foo() { var y = 20; function bar() { var z = 30; alert(x + y + z); } bar();
} foo(); // 60 전역 컨텍스트의 변수 객체 : globalContext.VO === Global = { x: 10 foo: <reference to function>
}; foo 생성 시점에 foo 의 [[Scope]] 프로퍼티 : foo.[[Scope]] = [ globalContext.VO
