} (function () { var x = 20; foo(); // 10, but not 20
})(); 변수 x 는 foo 함수의 [[Scope]] 에 있는 것을 알 수 있다. 변수를 검색할 때, 함수 호출 시점의 동적인 체인(이 경우 변수 x 의 값은 20이 될 것이다)이 아닌, 함수 생성 순간에 정의된 어휘적인 체인을 이용하였다. function foo() { var x = 10; var y = 20; return function () { alert([x, y]); };
} var x = 30;
