ECMAScript 에는 코드 실행 런타임에 ScopeChain을 변경할 수 있는 두 가지 구문이 있다. with 문과 catch 절이다. 구문 내에 나타나는 식별자를 찾기 위한 객체를 ScopeChain의 가장 앞에 추가한다. 이 중에 하나를 코드에 적용하면, ScopeChain은 아래와 같이 변경된다. Scope = withObject|catchObject + AO|VO + [[Scope]] with 문의 경우에는 파라미터로 넘겨 받은 객체를 추가한다(결과, 이 객체의 프로퍼티에 접두사를 붙이지 않고 접근할 수 있다) var foo = {x: 10, y: 20}; with (foo) { alert(x); // 10 alert(y); // 20
} Scope = foo + AO|VO + [[Scope]] var x = 10, y = 10; with ({x: 20}) { var x = 30, y = 30; alert(x); // 30 alert(y); // 30
} alert(x); // 10
alert(y); // 30 x = 10, y = 10 객체 { x : 20 }을 ScopeChain의 앞에 추가한다. 컨텍스트 진입 단계에서 모든 변수를 해석하고 추가했기 때문에 with 내에서 var 구문을 만났을 때 아무것도 만들지 않는다. 오직 x 의 값을 수정하는데, 정확하게는 두 번째 단계에서 ScopeChain의 앞에 추가된 객체 내에서 해석되는 x 를 말한다. 20이었던 x 의 값이 10이 된다. 또한 위의 변수 객체 내에서 해석되는 y 도 변경한다. 결과적으로 10이었던 y 의 값이 30이 된다. 다음으로 with 문이 종료된 후에, 스페셜 객체는 ScopeChain에서 제거된다( x 의 값이 변경되고, 30 또한 객체에서 제거된다). 즉, ScopeChain 구조가 with 문에 의해서 확장되기 이전 상태로 돌아온다. 마지막에 있는 두 번의 alert 호출을 통해서 알 수 있듯이, 현재 변수 객체 내에 있는 x 의 값은 같은 상태로 남아있고, y 의 값은 with 문 내에서 변경한 상태 그대로 30이다. catch 절 또한 exception 파라미터에 접근하기 위해서 exception 파라미터의 이름을 유일한 프로퍼티로 갖는 중간 스코프 객체를 만들며, 이 객체를 ScopeChain의 앞에 추가한다. try { ...
} catch (ex) { alert(ex);
} var catchObject = { ex: <exception object>
}
Scope = catchObject + AO|VO + [[Scope]] catch 절 내의 작업이 종료된 후에, ScopeChain은 이전 상태로 돌아온다. Reference scope-chain

