왜 괄호로 함수를 감싸야 선언과 동시에 호출할 수 있지? 그 답은 바로 표현식 구문이 가지는 제약 때문이었다. 표준에 따라서, 표현식 구문은 여는 중괄호, { 로 시작할 수 없다. 블록과 구분할 수 없기 때문이다. 그리고 함수 선언과 구분하기 힘들기 때문에 함수 키워드로 시작해서도 안 된다. 다시 말해서, 즉시 실행 함수(function 키워드로 시작하는)를 만들기 위해서 아래와 같이 함수 선언식을 작성했다면 function () {...}();// 또는 아래와 같이 이름이 있는.
function foo() {...}(); 두 경우 모두 파서가 해석 에러를 보고할 것이다. 이 에러의 원인은 다양하겠지만, 전역 코드에 이렇게 선언을 하면(즉, 프로그램 레벨에), function 키워드로 시작하기 때문에 파서는 코드를 함수 선언식으로 이해한다. 첫 번째 경우는 함수의 이름이 없어서 SyntaxError 를 보고한다. 두 번째의 경우는 함수에 이름( foo )이 존재하기 때문에 파서가 정상적인 함수 선언으로 처리한다. 하지만 내부에 표현식이 없는 그룹화 연산자 를 사용하고 있음을 알리는 문법 에러가 발생한다. 이 경우에 함수 선언 뒤에 오는 것은 함수 호출을 위한 괄호가 아니라 그룹화 연산자일 뿐이다. 만약 코드를 다음과 같이 작성했다면, // "foo"는 함수 선언이다
// 그리고 실행 컨텍스트 진입 시점에 생성한다.
alert(foo); // function
function foo(x) { alert(x);
}(1); // 이것은 호출이 아니라, 그룹화 연산자다. foo(10); // 10 함수 선언과 표현식 (1) 을 가지고 있는 그룹화 연산자가 있어서 두 구문 모두 아무런 문제가 없다. 위의 예제는 아래의 예제와 같다. // 함수 선언
function foo(x) { alert(x);
}
// 표현식이 있는 그룹화 연산자
(1);
// 다른 (function) 표현식을 갖는 또 다른 그룹화 연산자
(function () {}); // 내부에 있는 표현식
("foo"); ECMA 스펙상으로 볼 때, 위의 코드는 잘못된 구문이다(표현식 구문은 function 키워드로 시작할 수 없다). 하지만 아래에 나와 있는 것처럼, 문법 에러를 제공하는 ECMAScript 구현체는 하나도 없으며 모두 이를 각자 나름의 방식으로 처리한다. 지금까지 설명한 내용을 가지고, 어떻게 파서에게 함수를 생성과 동시에 실행하고 싶다고 할 수 있을까? 함수 선언식이 아닌 함수 표현식을 사용하면 된다. 표현식을 만드는 가장 간단한 방법은 위에서 이야기했듯이 그룹화 연산자를 사용한다. 그룹화 연산자 안에 표현식을 두면, 파서는 함수 표현식( FE )인 코드를 구분할 수 있으며 이에 따라 모호함도 사라진다. 이러한 함수는 코드 실행 단계 동안에 만들어지고, 함수 실행이 끝난 후에는 사라진다(함수를 참조하고 있는 곳이 없다면). (function foo(x) { alert(x);
})(1); // 이건 그룹화 연산자가 아닌 함수 호출이다. 예제의 마지막에 있는 괄호는 FD 의 경우처럼 그룹화 연산자가 아니라 함수 호출 괄호다. 다음 예제에 나오는 즉시 호출 함수는 괄호로 감쌀 필요가 없다는 것에 주목하자. 이유는 함수가 표현식의 위치에 있어서 파서가 이를 코드 실행 시점에 생성하는 FE 로 처리해야 한다는 것을 이미 알고 있기 때문이다. var foo = { bar: function (x) { return x % 2 != 0 ? 'yes' : 'no'; }(1)
}; alert(foo.bar); // 'yes' 얼핏보면 foo.bar 는 함수가 아니라 문자열처럼 보인다. 여기에 있는 함수는 프로퍼티를 초기화할 때만 사용하는데, 조건 매개변수 값에 따라서 값을 돌려주는 함수를 만들고 바로 실행한다. 따라서, 괄호 를 묻는 질문에 완벽한 대답은 다음과 같다. :star: 중요 :star: 그룹화 괄호는 함수가 표현식의 위치에 있지 않을 때 필요하고, 함수를 생성 후 즉시 실행하고 싶은 경우에는 직접 함수를 FE로 변환한다. 괄호를 감싸는 방법 외에 함수를 FE 타입으로 변경할 수 있는 다른 방법이 있다. 예를 들어, 1, function () { alert('익명함수를 호출합니다.');
