230.body:
변수와 상수를 구분하는 성질은 변경 가능성 이다. 바꿀 수 있으면 변수, 바꿀 수 없으면 상수라는 것이다. 상수와 불변성은 같은 개념이 아니다. 변수와 상수를 구분 짓는 변경 가능성의 대상은 변수 영역 메모리 다. 한 번 데이터 할당이 이루어진 변수 공간에 다른 데이터를 재할당할 수 있는지가 관건이다. 반면, 불변성 여부를 구분할 때의 변경 가능성의 대상은 데이터 영역 메모리 다. 결국, 기본형 데이터인 Number, Strubg, Boolean, null, undefined, Symbol 모두 불변값이다. var a = 'abc';
a = a + 'def'; var b = 5;
var c = 5;
b = 7 변수 a 에 문자열 abc 를 할당했다가 뒤에 def 를 추가하면 기존의 abc 가 abcdef 로 바뀌는 것이 아니라 새로운 문자열 abcdef 를 만들어 그 주소를 변수 a에 저장한다. 즉 abc 와 abcdef 는 완전히 별개의 데이터다.

