참조형 데이터는 가변값이다. var obj1 = { a: 1, b: 'bbb'
}; 기본형 데이터와의 차이는 객체의 변수(프로퍼티) 영역 이 별도로 존재한다는 점이다. var obj1 = { a: 1, b: 'bbb'
}; obj1.a = 2; 위와 같이 obj1 의 a 에 값을 재할당하게 되면 2 가 들어갈 공간을 새로 만들어서 데이터를 넣어주고, 식별자 a 값에 새로 만든 2 가 들어가 있는 공간의 주솟값을 넣게 된다. 이렇게 되면 a 는 값만 바뀌는 것이다. 참조 카운트가 0 이 되는 메모리 주소는 가비지 컬렉션의 수거 대상이 된다. 가비지 컬렉터는 런타임 환경에 따라 특정 시점이나 메모리 사용량이 포화 상태에 임박할 때마다 자동으로 수거 대상들을 수거한다. 수거된 메모리는 다시 새로운 값을 할당할 수 있는 빈 공간이 된다.

232.body:
기본형과 참조형의 복사를 비교해보자. var a = 10;
var b = a; var obj1 = { c: 10, d: 'ddd'
}
var obj2 = obj1 먼저 a 는 10 이 들어가 있는 데이터 영역의 주소를 값으로 가진다. b 는 이런 a 를 값을 그대로 가져왔으므로 같은 값을 가지게 된다. 참조형도 같다. obj1에 들어가는 데이터 영역과 변수 영역의 주솟값을 obj1의 값으로 넣게 되고 obj2는 obj1의 값을 똑같이 가지게 된다. 여기서 중요한 건 값을 바꿀 때 일어난다. var a = 10;
var b = a; var obj1 = { c: 10, d: 'ddd'
}
var obj2 = obj1 b = 15
obj2.c = 20; b 에 새로운 값을 할당하려고 한다. 그렇다면 데이터 영역에 값이 15 인 값이 있는 곳을 찾고 없다면 새로운 공간을 만들며 해당 공간의 주솟값을 b 에 재할당한다. obj2.c 의 값을 재할당하게 되면 객체의 변수 영역인 c 의 공간의 값을 재할당하는 일이 이루어진다. 그러나 obj2 자체의 값을 바뀌지 않는다. 이같이 되면 obj1 값과 obj2의 값은 여전히 동일하다. console.log(a !== b) // true
console.log(obj1 === obj2) // true 일반적으로 '기본형도 결국 주솟값을 참조한다'

