234.body:
객체의 가변성에 따른 문제점이 있다. var user = { name: 'josh', gender: 'male'
} var changeName = function(user, newName){ var newUser = user; newUser.name = newName; return newUser;
} var user2 = changeName(user, 'snyung') if(user !== user2){ console.log('유저 정보가 변경되었습니다.')
} console.log(user.name, user2.name); // snyung snyung
console.log(user === user2) // true 위와 같은 문제점이 발생하였다. 이름을 바꾸었지만 실제로 객체의 값은 변하지 않아서 변하지 않은 것으로 인식하며, 객체의 값도 같게 된다. 위의 코드를 해결해보자. var user = { name: 'josh', gender: 'male'
} var changeName = function(user, newName){ return { name: newName, gender: user.gender };
} var user2 = changeName(user, 'snyung') if(user !== user2){ console.log('유저 정보가 변경되었습니다.')
} console.log(user.name, user2.name); // josh snyung
console.log(user === user2) // false 반환값으로 새로운 객체를 만들어서 반환하도록 수정되었다. 이게 두 개의 객체의 값을 다르게 되어 정보가 바뀌었다고 인식을 하게 된다. 그러나 우리가 새로운 객체를 만들면서 변경할 필요가 없는 기존 객체의 프로퍼티를 하드코딩하고 있다. 이런식으로 작성하게 되면 정보가 많을수록 변경해야하는 정보가 늘어나게 된다. 그냥 모든 프로퍼티를 복사하는 함수를 만드는 것이 좋아 보인다. var copyObjec = function (target){ var result = {}; for (var prop in target){ result[prop] = target[prop]; } return result;
}; var user = { name: 'josh', gender: 'male'
} var user2 = copyObjec(user)
user2.name = 'snyung' if(user !== user2){ console.log('유저 정보가 변경되었습니다.')
} console.log(user.name, user2.name); // josh snyung
console.log(user === user2) // false 우리가 만든 함수는 위와 같은 예제에서는 제대로 작동하고 있다. 그러나 얕은 복사 만 수행한다는 점이 아쉽다.

235.body:
얕은 복사는 바로 아래 단계의 값만 복사하는 방법이며, 깊은 복사는 내부의 모든 값을 하나하나 찾아서 전부 복사하는 방법이다. 얕은 복사를 하게 되면 한 단계 아래의 값들은 새로 만들어지기 때문에 불변성을 보장한다. 그러나 2단계 이상으로 들어가게 되면 기존의 데이터를 그대로 참조하고 있게 된다. var user2 = copyObject(user);
user2.urls = copyObject(user.urls); user.urls.profile = 'http://protfolio.com';
console.log(user.urls.protfolio = user2.urls.protfolio); // false user2.urls.blog = '';
console.log(user.urls.blog === user2.urls.blog); // false 위의 결과를 보게 되면 모든 값을 새로 만들어서 할당하였더니 값이 다 다르다고 나오게 된다. 이에 우리는 기본형 데이터일 경우에는 그대로 복사하고, 참조형 데이터는 다시 그 내부의 프로퍼티들을 복사해야 한다는 것을 알게 되었다. var copyObjectDeep = function(target) { var result = {}; if (typeof target === 'object' && target != null){ for (var prop in target){ result[prop] = copyObjectDeep(target[prop]) } } else { result = target } return result;
} 객체인 경우 재귀적으로 함수를 재귀적으로 호출하며, 객체가 아닌 경우 원본을 그대로 넣어주고 있다. 위와 같이 재귀적으로 호출하는 방식으로 DeepCopy를 할 수 있지만, JSON 객체로도 가능하다. var copyObjectViaJSON = function (target){ return JSON.parse(JSON.stringify(target))
}

236.body:
자바스크립트에서, 없음을 나타내는 값은 두 가지가 있다. undefined 는 사용자가 명시적으로 지정할 수도 있지만, 값이 존재하지 않을 때 자바스크립트 엔진이 자동으로 부여하는 경우도 있다. 자바스크립트 엔진이 undefined 를 반환하는 경우는 아래와 같이 세 가지 경우다. 값을 대입하지 않는 변수. 즉 데이터 영역의 메모리 주소를 지정하지 않는 식별자에 접근할 때 객체 내부의 존재하지 않는 프로퍼티에 접근하려고 할 때 return 문이 없거나 호출되지 않는 함수의 실행 결과 var a;
console.log(a); // undefined var obj = {a:1};
console.log(obj.a); // a
console.log(obj.b); // undefined
console.log(b); // Uncaught ReferenceError: b is not defined var func = function() {};
var c = func();
console.log(c); // undefined 값을 대입하지 않는 경우에 대해 배열의 경우에는 조금 다르다. var arr1 = [];
arr1.length = 3
console.log(arr1); // [empty × 3] var arr2 = new Array(3); // [empty × 3]
console.log(arr2); var arr3 = [undefined, undefined, undefined];
console.log(arr3); // (3) [undefined, undefined, undefined] 위의 결과를 보게 되면 1 , 2 는 같은 결과를 출력하나 undefined 로 만들어서 출력한 것을 다르다는 것을 알 수 있다. 이처럼 비어있는 요소와 undefined 를 할당한 요소는 출력 결과부터 다르다. 비어있는 요소는 순회와 관련된 많은 배열 메서드들의 순회 대상에서 제외된다. var arr1 = [undefined, 1];
var arr2 = [];
arr2[1] = 1; arr1.foreach(function(v, i) { console.log(v, i); });
arr2.foreach(function(v, i) { console.log(v, i); }); arr1.map(function (v, i) { return v+i; });
arr2.map(function (v, i) { return v+i; }); arr1.filter(function (v, i) { return !v; });
arr2.filter(function (v, i) { return !v; }); arr1.reduce(function (p, c, i) { return p + c + i;}, '');
arr2.reduce(function (p, c, i) { return p + c + i;}, ''); 위의 결과가 다르게 나온다. 직접 undefined 를 할당한 arr1 에 대해서는 일반적으로 알고 있는 배열의 모든 요소를 순회해서 결과를 출력한다. 그러나 arr2 에 대한 결과를 보면, 각 메서드들이 비어있는 요소에 대해서는 어떠한 처리도 하지 않고 건너뛰었다. null 은 주의해야 할 점이 있다. typeof null 이 Object 라는 것이다. 이는 자바스크립트 자체 버그이다. 따라서 어떤 변수의 값이 null 인지 여부를 판별하기 위해서는 typeof 대신 다른 방식으로 접근해야 한다. var n = null;
