Block Statement는 우리가 많이 보는 if문, switch문, for, while문이다. 이러한 문장들은 괄호로 감싸진 부분이 존재하지만 새로운 Scope를 만들지는 않는다. Block Statement 안에서 정의한 변수는 가장 가까운 함수의 Scope에 붙게 된다. if (true) { // this 'if' conditional block doesn't create a new scope var name = 'snyung'; // name is still in the global scope
} console.log(name); // logs 'snyung' ECMAScript6에서 let , const 가 추가되었다. 이 2개는 var 대용으로 사용된다. 그러나 그보다 더 중요한 개념이 들어간다. 바로 Block Level Scope 라는 것이다. 기존의 자바스크립트는 위에서 본 것처럼 Functional Scope 이다. 그러나 let , const 를 사용하게 되면 Block Level Scope 지원이 가능하다. 아래의 예제를 보자 if (true) { // this 'if' conditional block doesn't create a new scope var name = 'snyung'; // name is still in the global scope let likes = 'Coding'; const skills = 'js';
} console.log(name); // logs 'snyung'
console.log(likes); // Uncaught ReferenceError: likes is not defined
console.log(skills); // Uncaught ReferenceError: skills is not defined var 와는 다르게 let , const 는 Block Statement내에서 Local Scope 를 지원한다. 즉, 이제 Scope가 가장 가까운 function에 붙는 것이 아닌 해당 Block에 붙게되는 것이다. Global Scope는 응용 프로그램이 살아있을 때까지 유효하며, Local Scope은 함수가 호출되고 실행되는 한 유지된다.

