function [name](param1, param2, ...param3) { // Function Body & Logic
} [function name] 앞에 [function keyword] 를 붙인다. 항상 앞에 function으로 시작하며 함수의 이름을 지어주어야 한다. 선언식의 주요한 개념은 **호이스팅(Hoisting)**이 된다는 것이다. 호이스팅으로 인해서 함수를 선언하기 전에 함수를 실행하는 코드를 넣어도 작동하는 것이다. 이러한 선언 방법은 일부 논리를 함수 본문으로 추상화를 하고 나중에 실제 구현이 완료될 때 유용하다. var num1 = 10;
var num2 = 20;
var result = add(num1, num2); // ==> 30 [Executing before declaring] function add(param1, param2) { return param1 + param2 ;
} 위와 같은 코드는 좋지 못하다. 항상 호이스팅을 이용하는 것이 아닌 함수를 먼저 선언을 하고 실행하는 습관을 들이는 것이 좋다.

