} 위에 코드를 보게 되면 표현식이 더이상 익명이 아니고 addFunction 이라는 이름을 가지고 있다. 또한 addVariable 이라는 변수명에 할당하였다. 우리가 함수의 이름으로 addFunction 을 추가했다고 실행할 수 있는 것은 아니다. var result = addFunction(num1, num2); // ==> Uncaught ReferenceError: addFunction is not defined 우리가 할당한 addVariable 변수로만 사용이 가능하다. var result = addVariable(num1, num2); // ==> 30 고려해야 할 사항 addFunction 이 addVariable 보다 콜스택상 먼저 나오게 된다. 외부에서 addFunction 을 호출하게 되면 에러가 나오게 된다. 그러나 내부에서는 addFunction 을 사용할 수 있다. var num1 = 10;
var num2 = 20;
var addVariable = function addFunction(param1, param2) { var res = param1 + param2; if (res === 30) { res = addFunction(res, 10); } return res;
}
