Call Stack은 LIFO (Last In, First Out) 원리를 사용하여 함수 호출을 임시 저장하고 관리하는 데이터 구조 LIFO : Last In, First Out의 데이터 구조 원칙에 따라 호출 스택이 작동한다. 스택으로 푸시 된 마지막 함수가 처음으로 튀어나옴을 의미한다. 자바스크립트에서 Call Stack은 주로 함수 호출에 된다. Call Stack이 하나이기 때문에 함수 실행은 위에서 아래로 한 번에 하나씩 수행된다. 기본적으로 자바스크립트는 싱글 쓰레드 프로그래밍 언어이다. 이 말은 싱글 Call Stack을 가지고 있다는 것을 의미한다. 다른 말로 하자면 한 번에 한 가지의 일만 한다는 것이다. function multiply(x, y) { return x * y;
}
function printSquare(x) { var s = multiply(x, x); console.log(s);
}
printSquare(5); 위와 같은 코드가 있다고 한다면 printSquare(5) ⇒ multiply(x, x) ⇒ console.log(s) ⇒ printSquare(5) 순으로 쌓이고 실행이 된다는 것을 의미한다. 각각 한 줄을 Stack Frame 이라고 한다. function foo() { throw new Error('Session Stack will help you resolve crashes :)');
} function bar() { foo();
} function start() { bar();
} start(); 위와 같은 코드를 Chrome에서 실행한다면 당연하게 에러가 떨어지면서 Stack 형태를 자세히 볼 수 있다. 다른 경우로는 Call Stack의 사이즈를 넘어서서 쌓이는 경우도 발생한다. function foo() { foo();
} foo(); 위와 같은 코드를 사용하면 안되겠지만 위와 같은 경우는 브라우저에서 계속 쌓아가다가 16000개가 넘어가는 순간에 Stack Size가 넘쳤다고 나올 것이다. 싱글 쓰레드는 멀티 쓰레드보다 다루기는 쉽다. (Deadlock(교착상태) 같은 일이 발생하지 않음으로) 그러나 역시 제한적이다. 예시로 내가 버튼을 눌러서 서버에서 사진을 가져오려고 할 때. 버튼을 누르고 사진을 가져올 때까지 브라우저는 멈춘 상태가 되어 버린다. 이에 대안으로 Asynchronous Callbacks 이다.

