logX(obj2); 동일한 프로퍼티 x 와 y 를 string 키로 가지는 두 객체가 있다면. 이 두 객체의 모양(shapes) 은 똑같다. 함수 logX 를 통해 두 객체 각각에서 같은 프로퍼티 x 에 접근한다. JavaScript 엔진은 프로퍼티 접근 시에 모양이 같은 점을 이용하여 최적화를 한다. B_Engine_6.png 객체의 키 x , y 는 각각의 속성 값(property attributes)을 가리킨다. 예를 들어 x 프로퍼티에 접근하게 되면 엔진은 Object 에서 x 키를 찾은 다음, 해당하는 속성 값을 불러오고 [[Value]] 값을 반환한다. 여기서 5와 6 같은 데이터는 어디에 저장되나? 모든 객체 별로 정보를 저장하게 되면 낭비가 된다. 비슷한 모양의 객체가 더 많이 생긴다면, 그만큼의 중복할 발생할 것이고 필요없는 메모리 사용이 늘어나게 되는 것이다. 그래서 엔진은 직접 값을 저장하는 방법 아래와 같은 방법을 사용하게 된다. B_Engine_7.png 우선 엔진은 따로 Shape 라는 곳에 프로퍼티 이름과 속성 값들을 저장한다. 여기에 [[value]] 값 대신 JSObject 의 어디에 값이 저장되어 있는지에 대한 정보인 Offset 을 Property information 으로 가지고 있는다. B_Engine_8.png 즉, 같은 모양을 가진 모든 JSObject는 동일한 Shape 인스턴스를 가리키게 되고, 각 객체에는 고유한 값만 저장되므로, 더 이상 중복되지 않는 것이다. 같은 모양으로 생긴 더 많은 오브젝트가 있다 하더라도 오로지 하나의 Shape 만 존재하게 된다.

98.body:
이런 Shape가 있다고 합시다. const o = {};
o.x = 5;
o.y = 6; 새로운 프로퍼티를 추가할 때, 엔진은 어떻게 새로운 Shape를 찾을수 있는 것일까? 엔진은 내부에 transition chains 라고 하는 Shape를 만든다. 먼저, 비어있는 객체인 o 가 있으며, 이는 비어있는 Shape를 가리킨다. B_Engine_9.png 여기에 5라는 값을 가진 x 라는 프로퍼티를 추가하게 되면, 비어있던 Shape에서 x 를 프로퍼티로 가지고 있는 새로운 Shape로 이동 (transition)하게 된다. 다음과 같이 JSObject 의 값이 추가되고, offset 은 0이다. B_Engine_10.png 새로운 프로퍼티 y를 추가해도 똑같이 작동하게 된다. Shape(x,y) 로 이동한 다음 값을 추가한다. B_Engine_11.png 하지만 이런 방법을 모든 테이블에 항상 적용했다가는 많은 메모리 낭비를 일으키겠지요. 그래서 실제로 엔진은 이렇게 동작하지 않습니다.
